use std::collections::HashMap;

pub struct Solution;

impl Solution {
    pub fn is_anagram(s: String, t: String) -> bool {
        let mut counts = HashMap::with_capacity(s.len());

        for c in s.chars() {
            *counts.entry(c).or_insert(0) += 1u32;
        }

        for c in t.chars() {
            let entry = counts.entry(c).or_insert(0);
            if *entry == 0 {
                return false;
            }
            *entry -= 1;
        }

        counts.values().all(|count| *count == 0)
    }
}

#[cfg(test)]
mod tests {
    use super::*;

    #[test]
    fn test1() {
        let s = "anagram".to_string();
        let t = "nagaram".to_string();
        assert!(Solution::is_anagram(s, t));
    }

    #[test]
    fn test2() {
        let s = "rat".to_string();
        let t = "car".to_string();
        assert!(!Solution::is_anagram(s, t));
    }

    #[test]
    fn test3() {
        let s = "".to_string();
        let t = "".to_string();
        assert!(!Solution::is_anagram(s, t))
    }

    #[test]
    fn test4() {
        let s = "".to_string();
        let t = "".to_string();
        assert!(Solution::is_anagram(s, t))
    }
}
